(34, 'rs', '36', 'Dopunska podešavanja za prodavce', '<p>Ukoliko prodajete proizvod, neophodno je da definišete neophodne podatke u formi ispod.</p>\r\n<p>Prenos novca prodatog proizvoda vrši se isključivo uplatom na Vaš tekući račun, te je nežno da popunite ovo polje tačnim brojem računa.</p>\r\n<p>Takođa, neophodno je da unesete cenu dostavekoja će se primenjivati na sve proizvode koje prodajete. Ukoliko će cena dostave za neki proizvod biti drugačija, imaćete mogućnost da to podesite pri unosu proizvoda.</p>\r\n<ul>\r\n<li>Odaberite \"Besplatna dostava\" ukoliko je to Vaša opcija.</li>\r\n<li>Odaberite \"Besplatna dostava preko limita\", a zatim unesite limit preko kojeg dajete besplatnu dostavu.</li>\r\n<li>Odaberite \"Fiksna cena dostave\", a zatim unesite cenu dostave koja se primenjuje na sve proizvode.</li>\r\n</ul>', '', 'dopunska-podesavanja-za-prodavce', '', '', '', '', '', '');
