INSERT INTO `prol` (`id`, `lang`, `id_text`, `naslov`, `ulink`, `marka`, `opis`, `opis1`, `h2`, `title`, `keywords`, `description`, `altslike`, `titleslike`) VALUES
(20, 'rs', '20', 'Real Fit Moisture Cushion - Puder za Lice Medium Beige', 'real-fit-moisture-cushion-puder-za-lice-medium-beige', 'Real Fit Moisture Cushion', '<p><strong>Real Fit Moisture Cushion</strong> prekriva nesavšenosti, ujednačava ten i hidrira kožu. Real Fit Moisture Cushion ima zaštitni faktor SPF 50+, kao i najviši PA +++ rejting.</p>\r\n<h2>Zašto je Real Fit Moisture Cushion bolji od ostalih pudera?</h2>\r\n<p><strong>1.</strong> Real Fit Moisture Cushion hidrira kožu i sprečava njeno isušivanje izazvano spoljnim uticajima.<br /><strong>2.</strong> Uz Real Fit Moisture Cushion ne morate da nanosite zasebno kremu za sunčanje jer u sebi sadrži najviše faktore zaštite od sunčevih zraka – SPF 50+ i PA+++.<br /><strong>3.</strong> Real Fit Moisture Cushion ima laganu strukturu i pruža svež i sjajan krajnji efekat na koži (tkz. dewy &amp; glossy finish).</p>\r\n<h3>Nanošenje</h3>\r\n<p><strong>1.</strong> Koristeći sundjerčić naneti puder na lice tapkajućim pokretima.<br /><strong>2.</strong> Naneti tanak sloj za prirodan look.<br /><strong>3.</strong> Za intenzivniju pokrivenost ponoviti postupak.</p>\r\n<h4>Nakon upotrebe</h4>\r\n<p>Zatvoriti poklopac nakon upotrebe kako puder ne bi izgubio svoju svežinu, hidratantnost i delotvorna svojstva.<br /><br />Pakovanje:15g </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Real Fit Moisture Cushion Puder za Lice Medium Beige', 'https://www.youtube.com/watch?v=86BmSaXZMHw', 'Village 11 Factory Real Fit Moisture korejski Cushion Puder za Lice Medium Beige ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Real Fit Moisture Cushion Puder za Lice Medium Beige', 'Village 11 Factory Real Fit Moisture Cushion Puder za Lice Medium Beige'),
(14, 'rs', '14', 'Sa limitom 1000', 'sa-limitom-1000', 'Real Fit Muse Lipstick', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>', NULL, NULL, '', '', '', '', ''),
(15, 'rs', '15', 'Real Fit Muse Lipstick - Ruž za usne Rosette Beige', 'real-fit-muse-lipstick-ruz-za-usne-rosette-beige', 'Real Fit Muse Lipstick', '<h2>Opis proizvoda</h2>', NULL, NULL, '', '', '', '', ''),
(16, 'rs', '16', 'Besplatna dostava', 'besplatna-dostava', '', '<h2>Opis proizvoda</h2>\r\n<p><strong>Real Fit Muse Lipstick</strong> čini usne sjajnim (efekat - polu mat), ima postojanu boju duže vreme, ne ramazuje se i posebno odabranim sastojcima hrani usne.</p>', NULL, NULL, '', '', '', '', ''),
(17, 'rs', '17', 'Real Fit Muse Lipstick - Ruž za usne Muse Coral', 'real-fit-muse-lipstick-ruz-za-usne-muse-coral', 'Real Fit Muse Lipstick', '<h2>Opis proizvoda</h2>\r\n<p><strong>Real Fit Muse Lipstick</strong> čini usne sjajnim (efekat - polu mat), ima postojanu boju duže vreme, ne ramazuje se i posebno odabranim sastojcima hrani usne.</p>\r\n<p><strong>Real Fit Muse Lipstick</strong> je obogaćen slatkim uljem badema, masline, makadamije i jojobe i time neguje usne i čini ih vizuelno punijim.</p>\r\n<h3>Način nanošenja</h3>\r\n<p><strong>1.</strong> Real Fit Muse Lipstick možete nežno natapkati za moderan, prirodan look, ili klasično naneti i time posteći punu pokrivenost.</p>\r\n<p><strong>2.</strong> Kombinovanjem 2 ili više Real Fit Muse karmina mogu da se dobiju jedinstvene boje.</p>\r\n<p><img class=\"img-fluid\" title=\"kombinacija više boja karmina\" src=\"https://amorinacosmetics.com/useruploads/images/komb.jpg\" alt=\"Karnim za usta\" width=\"744\" height=\"169\" /></p>\r\n<p><strong>Real Fit Muse Lipstick</strong> su zamišljeni tako da su im formule kompatibilne što omogućava kombinovanje boja i kreiranje unikatnih nijansi u zavisnosti od prilike, raspoloženja, modnih trendova i godišnjih doba.</p>\r\n<p>Pakovanje: 3,5 g</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, '', '', '', '', ''),
(18, 'rs', '18', 'Real Fit Muse Lipstick - Ruž za usne Vivid Pink', 'real-fit-muse-lipstick-ruz-za-usne-vivid-pink', '', '<h2>Opis proizvoda</h2>\r\n<p><strong>Real Fit Muse Lipstick</strong> čini usne sjajnim (efekat - polu mat), ima postojanu boju duže vreme, ne ramazuje se i posebno odabranim sastojcima hrani usne.</p>\r\n<p><strong>Real Fit Muse Lipstick</strong> je obogaćen slatkim uljem badema, masline, makadamije i jojobe i time neguje usne i čini ih vizuelno punijim</p>', NULL, NULL, '', '', '', '', ''),
(19, 'rs', '19', 'Real Fit Moisture Cushion - Puder za Lice Deep Beige', 'real-fit-moisture-cushion-puder-za-lice-deep-beige', 'Real Fit Moisture Cushion', '<p><strong>Real Fit Moisture Cushion</strong> prekriva nesavšenosti, ujednačava ten i hidrira kožu. Real Fit Moisture Cushion ima zaštitni faktor SPF 50+, kao i najviši PA +++ rejting.</p>\r\n<h2>Zašto je Real Fit Moisture Cushion bolji od ostalih pudera?</h2>\r\n<p><strong>1.</strong> Real Fit Moisture Cushion hidrira kožu i sprečava njeno isušivanje izazvano spoljnim uticajima.<br /><strong>2.</strong> Uz Real Fit Moisture Cushion ne morate da nanosite zasebno kremu za sunčanje jer u sebi sadrži najviše faktore zaštite od sunčevih zraka – SPF 50+ i PA+++.<br /><strong>3.</strong> Real Fit Moisture Cushion ima laganu strukturu i pruža svež i sjajan krajnji efekat na koži (tkz. dewy &amp; glossy finish).</p>\r\n<h3>Nanošenje</h3>\r\n<p><strong>1.</strong> Koristeći sundjerčić naneti puder na lice tapkajućim pokretima.<br /><strong>2.</strong> Naneti tanak sloj za prirodan look.<br /><strong>3.</strong> Za intenzivniju pokrivenost ponoviti postupak.</p>\r\n<h4>Nakon upotrebe</h4>\r\n<p>Zatvoriti poklopac nakon upotrebe kako puder ne bi izgubio svoju svežinu, hidratantnost i delotvorna svojstva.</p>\r\n<p>Pakovanje:15g </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Cushion Puder Deep Beige', '', 'Village 11 Factory korejski Cushion Puder Deep Beige ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Cushion Puder', 'Village 11 Factory Cushion Puder Deep Beige'),
(21, 'rs', '21', 'Smiling Eye Patch - Maskice za predeo ispod očiju', 'smiling-eye-patch-maskice-za-predeo-ispod-ociju', 'Smiling Eye Patch', '<p><strong>Smiling Eye Patch</strong> hidrogel maskice za područje ispod očiju povećavaju elastičnost i otklanjaju znakove umora, ublažuju podočnjake i pružaju svežiji, odmorniji izgled. Praktično pakovanje je pogodno za putovanja.</p>\r\n<h4>Magični sastojci</h4>\r\n<p>1. <strong>Islandska Voda</strong> koja je bogata mineralima neguje područje ispod očiju, vraća vitalnost i jača barijere kože.<br />2. <strong>Ekstrakt Sladića</strong> koji poboljšava imunitet kože,oporavlja i smiruje osetljivu kožu.<br />3. <strong>Ekstrakt Acerole</strong>, koji ima sjajna antioksidansna svojstva, ujednačava ten i pozitivno deluje na tamne podočnjake.<br />4. <strong>Oligo-HA</strong> koja u poređenju sa normalnom hijaluronskom kiselinom ima još intenzivnija svojstva hidratacije i nege, omogućava koži da upije korisne sastojke maske, sprečava dehidrataciju i time održava dobar balans kože.<br />5. <strong>Hidrogel materijal</strong> intenzivira efekat hidratacije i nege.</p>\r\n<h3>Upotreba</h3>\r\n<p><strong>1.</strong> Nakon otvaranja pakovanja, otvoriti kesicu sa maskicama i staviti maskice ispod očiju.<br /><strong>2.</strong> Nakon 20-40 minuta, skloniti maskicu i dozvoliti da preostali sadržaj lepo upije blago tapkajući vrhovima prstiju.<br /><strong>3.</strong> Za razhlađujući efekat držati maskice u frižideru 15-20 minuta pre nanošenja.<br /><br />Pakovanje: 4g </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Smiling Eye Patch Maskice za oko očiju', '', 'Village 11 Factory Smiling Eye Patch korejske Maskice za oko očiju ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Smiling Eye Patch Maskice za oko očiju', 'Village 11 Factory Smiling Eye Patch Maskice za oko očiju'),
(22, 'rs', '22', 'Limit za besplatnu 2000 dostava 300', 'limit-za-besplatnu-2000-dostava-300', '', '<h2>Opis proizvoda</h2>\r\n<p>Tajna formula Daily Fresh up maske sa ekstratkom Aloje Vere, poznata je u tertiranju blagih upala, infekcija i inflamacija kože. Pored toga, omekšava, hidrira i oporavlja suvu i grubu kožu.</p>', NULL, NULL, '', '', '', '', ''),
(23, 'rs', '23', 'Daily Fresh Up Mask Lemon - Maska za lice sa limunom', 'daily-fresh-up-mask-lemon-maska-za-lice-sa-limunom', 'Daily Fresh Up Mask Lemon', '<h2>Opis proizvoda</h2>\r\n<p>Tajna formula Daily Fresh up maske sa ekstraktom Limuna, bogata vitaminom C i antioksidansima, pomaže hidrataciji, obnovi i revitalizaciji umorne i kože bez sjaja. Sastojci ove maske pozitivno utičnu na blage diskoloracije, fleke od sunca i ožiljke.</p>\r\n<p>Hipoalergijska svojstva Daily Fresh up maske sa ekstratkom Limuna čine je pogodnom za sve tipove kože. Uz redovnu upotrebu Vaša koža će biti sjajnija, čistijija i zategnutija, a ten ujednačeniji.</p>\r\n<h4>Magični sastojci</h4>\r\n<p>1.<strong> Ekstrakt Limuna</strong> koji je bogat vitaminom C pruža podmlađujuć efekat, neguje i hidrira kožu čineći je sjajnijom. Takođe je poznat po svojstvima izbeljivanja te pozitivno deluje na crvenila izazvana aknama, flekicama od sunca ili ožiljcima, kao i na diskoloracije na koži.<br />2.<strong> Vitamin C</strong> i antioksidansi pospešuju proizvodnju kolagena i obnovu ćelija ostavljajući kožu sjajnom i zategnutom.<br />3.<strong> Ekstrakt Chia semenke</strong> koji se bori protiv crvenila, iritacije i dehidratacije. Takođe umanjuje vidljivost bubuljica i bora.<br />4.<strong> Tigrova Trava</strong> koja je poznata po anti-aging svojstvima i u zaceljivanju rana. Pored toga, umiruje, oporavlja i hranu suvu kožu.<br />5.<strong> Sodium Hyalluronate</strong> koji pomaže da se nadomesti nedostatak hijaluronske kiseline usled starenja i izloženosti suncu. Takođe hidrira i ima neiritirujuća svojstva pogodna za osetljivu kožu.</p>\r\n<h3>Upotreba</h3>\r\n<p><strong>1.</strong> Nakon čišćenja lica <a href=\"https://amorinacosmetics.com/proizvodi/moisture-cleansing-foam-pena-za-ciscenje-lica/\" target=\"_blank\">penom</a> i apliciranja <a href=\"https://amorinacosmetics.com/proizvodi/moisture-toner-za-lice/\" target=\"_blank\">tonera</a>, otvoriti masku i staviti je na lice prateći otvore za oči, nos i usta. Za potpuni efekat, pažljivo pritisnuti masku kako bi lepo legla na kožu.<br /><strong>2.</strong> Držati masku 10-20 minuta. Ne držati masku predugo jer će ponovo upiti esenciju sa kože.<br /><strong>3.</strong> Ukloniti masku, a ostatak esencije utapkati.</p>\r\n<p>Pakovanje: 20 grama.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Daily Fresh Up Mask Lemon Maska za lice sa limunom', '', 'Village 11 Factory Daily Fresh Up Mask Lemon korejska sheet Maska za lice sa limunom ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Daily Fresh Up Mask Lemon Maska za lice sa limunom', 'Village 11 Factory Daily Fresh Up Mask Lemon Maska za lice sa limunom'),
(24, 'rs', '24', 'Daily Fresh Up Mask Tea Tree - Maska za lice sa drvetom čaja', 'daily-fresh-up-mask-tea-tree-maska-za-lice-sa-drvetom-caja', 'Daily Fresh Up Mask Tea Tree', '<h2>Opis proizvoda</h2>\r\n<p>Tajna formula Daily Fresh up maske sa ekstraktom Čajnog Drveta hidrira i štiti osetljivu kožu od spoljnih uticaja i ima revitalizirajući i umirujući efekat na koži.</p>\r\n<p>Ova hipoalergijska maska je pogodna za sve tipove kože, a sastojci ove maske čine je posebno pogodnom za problematičnu i osetljivu kožu. Uz redovnu upotrebu Daily Fresh up maske sa ekstraktom Drveta Čaja Vaša koža će biti hidrirana, čistija i otpornija na negativne, spoljne uticaje.</p>\r\n<h4>Magični sastojci</h4>\r\n<p>1.<strong> Ekstrakt Drveta Čaja</strong> koji se sastoji od ekstrakta lista drveta čaja i Centella Asiatica ekstrakta, revitalizira i podmlađuje kožu, kontroliše sebum, umanjuje pore, neguje i umiruje kožu.<br />2.<strong> Ekstrakt Chia semenke</strong> koji se bori protiv crvenila, iritacije i dehidratacije. Takođe umanjuje vidljivost bubuljica i bora.<br />3.<strong> Tigrova Trava</strong> koja je poznata po anti-agning svojstvima i u zaceljivanju rana. Pored toga, umiruje i oporavlja osetljivu i suvu kožu.<br />4.<strong> Sodium Hyalluronate</strong> koji pomaže da se nadomesti nedostatak hijaluronske kiseline nastao usled starenja i prekomerne izloženosti suncu. Takođe ima i neiritirajuća svojstva koja su pogodna za osetljivu kožu.<br />5.<strong> Anti-inflamatorna i anti-bakterijska</strong> svojstva maske tretiraju blaže oblike akni, umiruju crvenilo, otečenost i upaljenost ostavljajući kožu glatkom i čistom.</p>\r\n<h3>Upotreba</h3>\r\n<p><strong>1.</strong> Nakon čišćenja lica <a href=\"https://amorinacosmetics.com/proizvodi/moisture-cleansing-foam-pena-za-ciscenje-lica/\" target=\"_blank\" rel=\"noopener\">penom</a> i apliciranja <a href=\"https://amorinacosmetics.com/proizvodi/moisture-toner-za-lice/\" target=\"_blank\" rel=\"noopener\">tonera</a>, otvoriti masku i staviti je na lice prateći otvore za oči, nos i usta. Za potpuni efekat, pažljivo pritisnuti masku kako bi lepo legla na kožu.<br /><strong>2.</strong> Držati masku 10-20 minuta. Ne držati masku predugo na licu jer će ponovo upiti esenciju sa kože.<br /><strong>3.</strong> Ukloniti masku, a ostatak esencije utapkati.</p>\r\n<p>Pakovanje: 20 grama.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, '', '', '', '', ''),
(25, 'rs', '25', 'Collagen Eye Cream - Krema za predeo oko očiju kolagen', 'collagen-eye-cream-krema-za-predeo-oko-ociju-kolagen', 'Collagen Eye Cream', '<h2>Krema za oko očiju sa kolagenom</h2>\r\n<p>Collagen Eye Cream - Krema za oko Očiju obogaćena kolagenom neguje i hrani osetljivu i delikatnu zonu oko očiju. Pored toga, dubinski hidrira, umanjuje izgled bora i pruža odmorniji i svežiji izgled.</p>\r\n<h3>Magični sastojci</h3>\r\n<p>1. <strong>Hidrolizovan kolagen i ekstrakt lista Limun verbene</strong> koji zadržavaju hidriranost kože duže vreme. Pored toga, hidrolizovan kolagen pozitivno deluje na proširene pore i regeneraciju kolagena u koži, povećava gustinu vlakana i umanjuje bore.<br />2. <strong>Ekstrakt Chia Semenke</strong> koji pomaže koži da povrati vitalnost i elastičnost štiteći je od negativnih, spoljnih uticaja.<br />3. <strong>Tigrova trava</strong> odnosno <strong>Centella Asiatica ekstrakt</strong> koja oporavlja iziritiranu kožu, čini je glatkijom i formira barijeru koja štiti kožu od spoljnih uticaja.<br />4. <strong>Houttuynia cordata ekstrakt</strong> koji neguje i stabilizuje oštećenu kožu, uklanja sebum, poboljšava opšte stanje kože i jača njenu otpornost pružajući joj zdrav, sjajan i svež izgled.<br />5. <strong>Sodium Hyaluronate</strong> koji sprečava suvoću kože i hrani je.<br />6. <strong>Saccharide hydrolysate</strong> koji neguje kožu čineći je glatkom i mekom na dodir.<br />7. <strong>Copper Tripeptide-1</strong> koji vraća koži elastičnost.</p>\r\n<h3>Upotreba</h3>\r\n<p>Nakon čišćenja lica Village 11 Factory Cleansing Foam penom i Village 11 Factory Moisture tonerom nežnim pokretima aplicirati kremu oko očiju.</p>\r\n<h5>Koraci u nezi lica</h5>\r\n<p>Pena za Umivanje – Toner za Lice – Maska za Lice – Krema za oko Očiju – Krema za Lice<br /><br />Pakovanje: 25ml </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Collagen Eye Cream Krema za oko očiju sa kolagenom', '', 'Village 11 Factory Collagen Eye Cream korejska Krema za oko očiju sa kolagenom ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Collagen Eye Cream Krema za oko očiju kolagen', 'Village 11 Factory Collagen Eye Cream Krema za oko očiju kolagen'),
(26, 'rs', '26', 'Collagen Cream - Krema za lice sa kolagenom', 'collagen-cream-krema-za-lice-sa-kolagenom', 'Collagen Cream', '<p>Collagen Cream - Krema za Lice obogaćena Kolagenom pruža koži elastičnost i čini je zategnutijom, otpornijom i svežijom uz lifting efekat. Redovnom upotrebom Collagen Cream kreme za lice Vaša koža će biti zategnutija, zdravija i sjajnija.</p>\r\n<h4>Magični sastojci</h4>\r\n<p>1. <strong>Hidrolizovan kolagen i ekstrakt lista Limun verbene</strong> koji zadržavaju hidriranost kože duže vreme. Pored toga, hidrolizovan kolagen pozitivno deluje na proširene pore i regeneraciju kolagena u koži, povećava gustinu vlakana i umanjuje bore.<br />2. <strong>Ekstrakt Chia Semenke</strong>, koji pomaže koži da povrati vitalnost i elastičnost štiteći je od negativnih, spoljnih uticaja.<br />3. <strong>Tigrova trava</strong> odnosno <strong>Centella Asiatica</strong> <strong>ekstrakt</strong> koja oporavlja iziritiranu kožu, čini je glatkijom i formira barijeru koja štiti kožu od spoljnih uticaja.<br />4. <strong>Houttuynia cordata ekstrakt</strong> koji neguje i stabilizuje oštećenu kožu, uklanja sebum, poboljšava opšte stanje kože i jača njenu otpornost pružajući joj zdrav, sjajan i svež izgled.<br />5. <strong>Sodium Hyaluronate</strong> koji sprečava suvoću kože i hrani je.<br />6. <strong>Saccharide hydrolysate</strong> koji neguje kožu čineći je glatkom i mekom na dodir.<br />7. <strong>Copper Tripeptide-1</strong> koji vraća koži elastičnost.</p>\r\n<h3>Upotreba</h3>\r\n<p>Nakon čišćenja lica Village 11 Factory Cleansing Foam penom i Village 11 Factory Moisture Tonerom nežnim pokretima aplicirati kremu.</p>\r\n<h5>Koraci u nezi lica</h5>\r\n<p>Pena za Umivanje – Toner za Lice – Maska za Lice – Krema za oko Očiju – Krema za Lice</p>\r\n<p>Pakovanje: 50ml</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Collagen Cream Krema za lice sa kolagenom', '', 'Village 11 Factory Collagen Cream korejska Krema za lice sa kolagenom ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Collagen Cream Krema za lice sa kolagenom', 'Village 11 Factory Collagen Cream Krema za lice sa kolagenom'),
(27, 'rs', '27', 'Snail Eye Cream - Krema za predeo oko očiju Puž', 'snail-eye-cream-krema-za-predeo-oko-ociju-puz', 'Snail Eye Cream', '<p>Snail Eye Cream - Krema za oko Očiju Puž hidrira i hrani osetljivu i delikantnu kožu oko očiju, a uz magični anti-aging sistem ublažuje bore i zateže kožu za mladalački, svež izgled.</p>\r\n<p>Snail Eye Cream bogata nutrijentima takođe poboljšava elastičnost kože i pomaže umornoj, slaboj i suvoj koži da izgleda sjajnije i zdravije.</p>\r\n<p>Korejska kozmenika na bazi filtrata puževe sluzi je sve popularnija u svetu zbog snažnih regenerativnih svojstava, intenzivne hidratacije i zaštite.</p>\r\n<p>Redovnom upotrebom Snail Eye Cream Kreme, koža oko očiju će biti svežijeg izgleda, a bore ublažene.</p>\r\n<h4>Magični sastojci</h4>\r\n<p>1. Snail Cream Krema za Lice Puž sadrži <strong>mucin filtrata sluzi puža (59%) i Propolis ekstrakt</strong> koji pozitivno deluju na suvu kožu i umanjuju bore.<br />2. <strong>Ekstrakt Chia Semenke</strong>, koji pomaže koži da povrati vitalnost i elastičnost štiteći je od negativnih, spoljnih uticaja.<br />3. <strong>Tigrova trava</strong> odnosno <strong>Centella Asiatica</strong> <strong>ekstrakt</strong> koja oporavlja iziritiranu kožu, čini je glatkijom i formira barijeru koja štiti kožu od spoljnih uticaja.<br />4. <strong>Houttuynia cordata ekstrakt</strong> neguje i stabilizuje oštećenu kožu, uklanja sebum, poboljšava opšte stanje kože i jača njenu otpornost pružajući joj zdrav, sjajan i svež izgled.</p>\r\n<h3>Upotreba</h3>\r\n<p>Nakon čišćenja lica Village 11 Factory Cleansing Foam Penom i Moisture Tonerom nežnim, tapkajućim pokretima aplicirati kremu na zonu oko očiju.</p>\r\n<h5>Koraci u Nezi Lica</h5>\r\n<p>Pena za Umivanje – Toner za Lice – Maska za Lice – Krema za oko Očiju – Krema za Lice<br /><br />Pakovanje:  25ml</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Snail Eye Cream Krema za oko očiju Puž', '', 'Village 11 Factory Snail Eye Cream korejska Krema za oko očiju Puž ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Snail Eye Cream Krema za oko očiju Puž', 'Village 11 Factory Snail Eye Cream Krema za oko očiju Puž'),
(28, 'rs', '28', 'Snail Cream - Krema za lice Puž', 'snail-cream-krema-za-lice-puz', 'Snail Cream', '<p>Snail Cream je hranljiva krema iz linije Puž koja obezbeđuje nutrijente potrebne za obnovu kože od negativnih, spoljnih uticaja. Korejska kozmenika na bazi filtrata puževe sluzi je sve popularnija u svetu zbog snažnih regenerativnih svojstava, intenzivne hidratacije i zaštite.</p>\r\n<p>Redovnom upotrebom koža će biti otpornija, glatkija i zdravijeg izgleda.</p>\r\n<h4>Magični sastojci</h4>\r\n<p>1. <strong>Mucin filtrata sluzi puža</strong> i <strong>Propolis ekstrakt</strong> koji pozitivno deluju na suvu kožu i umanjuju bore.<br />2. <strong>Ekstrakt Chia Semenke</strong>, bogat Tocopherolom i nutrijentima, koji pomaže koži da povrati vitalnost i elastičnost štiteći je od eksternih uticaja.<br />3. <strong>Tigrova trava</strong> odnosno <strong>Centella Asiatica ekstrakt</strong> koja oporavlja iziritiranu kožu, čini je glatkijom i formira barijeru koja štiti kožu od spoljnih uticaja.<br />4. <strong>Houttuynia cordata ekstrakt</strong> koji neguje i stabilizuje oštećenu kožu, uklanja sebum, poboljšava opšte stanje kože i jača njenu otpornost pružajući joj zdrav, sjajan i svež izgled.</p>\r\n<h3>Upotreba</h3>\r\n<p>Nakon čišćenja lica Moisture Cleansing Foam Penom i Moisture Tonerom nežnim pokretima aplicirati kremu. </p>\r\n<h5>Koraci u Nezi Lica</h5>\r\n<p>Pena za Umivanje – Toner za Lice – Maska za Lice – Krema za oko Očiju – Krema za Lice</p>\r\n<p>Pakovanje: 50ml</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Snail Cream Krema za lice Puž', '', 'Village 11 Factory Snail Cream korejska Krema za lice Puž ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Snail Cream Krema za lice Puž', 'Village 11 Factory Snail Cream Krema za lice Puž'),
(29, 'rs', '29', 'Besplatna dostava, ali ima novu cenu 600', 'besplatna-dostava-ali-ima-novu-cenu-600', '', '<p>Visoko efikasna Moisture Cleansing Foam - Pena za Lice je namenjena za umivanje i čišćenje lica, kao i za skidanje šminke. Moisture Cleansing Foam čisti lice i uklanja šminku i nečistoće ostavljajući kožu mekom i hidriranom.</p>\r\n<p>Pakovanje 150ml</p>', NULL, NULL, '', '', '', '', ''),
(30, 'rs', '30', 'Moisture Toner za lice', 'moisture-toner-za-lice', 'Moisture ', '<p>Moisture Toner za Lice dubinski čisti, revitalizira i neguje kožu lica čineći je glatkijom na dodir. Moisture Toner brzo upija, osvežava kožu i vraća joj prirodni sjaj.</p>\r\n<h4>Magični sastojci</h4>\r\n<p>1. Tajni sastojak Village 11 Factory je <strong>ekstrakt korena đavolje kandže</strong> – retke biljke, iz Kalahari pustinje, koja neguje i hrani kožu, ima anti-inflamatorna i anti-alergijska svojstva i poznata je u borbi sa nesavršenostima, aknama i upalama. Ova biljka je zaštićena i ugrožena vrsta, a zbog bezbroj korisnih svojstava dozvoljeno je da se bere u limitiranim količinama. Ekstrakt korena đavolje kandže takođe ima i anti-aging svojstva.<br />2. <strong>Bifidobacterium fermentacioni filtrat</strong> koji zahvaljujući mikrofinim česticama “budi” i zateže kožu pružajući joj mladolik izgled. <br />3. Moisture Toner je na bazi <strong>vode</strong> što omogućava brzu apsorpciju korisnih sastojaka tonera kao i ostalih proizvoda za negu lica.</p>\r\n<h3>Upotreba</h3>\r\n<p>Nakon čišćenja lica Moisture Cleansing Foam Penom za Lice, naneti na kožu Moisture Toner, uz pomoć vate ili tufera, blago tapkajući po licu.</p>\r\n<h5>Koraci u Nezi Lica</h5>\r\n<p>Pena za Umivanje – Toner za Lice – Maska za Lice – Krema za predeo oko očiju – Krema za Lice<br /><br />Pakovanje: 120ml  </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Moisture Toner za lice', '', 'Village 11 Factory Moisture korejski Toner za lice ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Moisture Toner za lice', 'Village 11 Factory Moisture Toner za lice'),
(31, 'rs', '31', 'Moisture Cream - Krema za Lice', 'moisture-cream-krema-za-lice', 'Moisture Cream', '<p>Moisture Cream krema za lice obezbeđuje intenzivnu hidrataciju ostavljajući kožu mekom, glatkom i dubinski nahranjenom. Redovnom upotrebom Moisture Cream kreme za lice Vaša koža lica će izgledati svežije, sjajnije i zdravije.</p>\r\n<h4>Magični sastojci</h4>\r\n<p><strong>1.</strong> Posebno dizajnirana i lagana formula Moisture Cream kreme za lice sadrži <strong>biljna ulja</strong> koja neguju kožu i zadržavaju hidrataciju duže vreme bez neprijatnog, lepljivog osećaja.<br /><strong>2.</strong> <strong>Eco Ceramide</strong> je kompleks 100% prirodnih ceramida koji brzo upijaju, hrane, omekšavaju i štite kožu od spoljnih uticaja. Ceramidi takođe imaju anti-bakterijska i anti-inflamatorna svojstva koja pomažu u detoksikaciji kože.<br /><strong>3.</strong> Stabilni <strong>visoko negujući emolijensi</strong> ili ovlaživači koji čine kožu blistavom, svežom i glatkom na dodir.<br /><strong>4.</strong> Tajni sastojak Village 11 Factory je <strong>ekstrakt korena đavolje kandže</strong> – retke biljke, iz Kalahari pustinje, koja neguje i hrani kožu, ima anti-inflamatorna i anti-alergijska svojstva i poznata je u borbi sa nesavršenostima, aknama i upalama. Ova biljka je zaštićena i ugrožena vrsta, a zbog bezbroj korisnih svojstava dozvoljeno je da se bere u limitiranim količinama. Ekstrakt korena đavolje kandže takođe ima i anti-aging svojstva</p>', NULL, NULL, '', '', '', '', ''),
