(32, 'rs', '32', 'Relax-Day Foot Mask - Maska za Stopala', 'relaxday-foot-mask-maska-za-stopala', 'Relax-Day Foot Mask', '<p>Relax Day maska za stopala sa Aqua Butter kompleksom oporavlja suva i umorna stopala čineći ih ponovo mekim i glatkim.</p>\r\n<p>Redovnom upotrebom Relax-Day maske Vaša stopala biće nežnija, mekša i hidrirana.</p>\r\n<h2>Zašto je Relax-Day maska za stopala bolja od sličnih proizvoda?</h2>\r\n<p><strong>1.</strong> Relax-day maska za stopala ima kremastu formulu koja nije lepljiva.<br /><strong>2.</strong> Do baby mekanih stopala za samo 20 minuta zahvaljujući posebno dizajniranoj formuli koja sadrži <strong>jojobu, suncokret i šafraniku</strong> koji neguju i omekšavaju umorna i suva stopala.<br /><strong>3.</strong> Obogaćena je <strong>Aqua Butter kompleks</strong> sa <strong>Aloe Butterom ™</strong> , koji sadrži ekstrakt aloje i ulje kokosa, i <strong>Rose Butter ™</strong> koji sadrži ulje kokosa, palmino kernel ulje i ulje ruže Damaska. Ovi pažljivo odabrani, čisti i nerazblaženi nutrijenti oporavljaju suvu kožu.<br /><strong>4.</strong> Tajni sastojak Relax-Day maske za ruke je <strong>koren đavolje kandže</strong> - retka biljka koja se od davnina koristi od strane afričkih starosedelaca za ublažavanje bola i zaceljenje rana. Đavolja kandža je vrlo retka i ugrožena biljka, te se jedino može brati u limitiranim količinama.</p>\r\n<h3>Upotreba</h3>\r\n<p>Nakon otvaranja pakovanja, razdvojiti masku prateći isprekidanu liniju. Staviti čista stopala u \"soknice\" koje su obložene esencijom. Zategnuti ih sa tračicama oko članaka. Nakon 15-20 minuta skinuti soknice, a preostalu esenciju utrljati.<br /><br />Pakovanje: 15g </p>\r\n<p><img title=\"Maska za stopala\" src=\"https://amorinacosmetics.com/useruploads/images/maska-za-stopala.jpg\" alt=\"Maska za stopala\" width=\"762\" height=\"185\" /></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Relax-Day Foot Mask Maska za Stopala', '', 'Village 11 Factory Relax-Day Foot Mask korejska sheet Maska za Stopala ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Relax-Day Foot Mask Maska za Stopala', 'Village 11 Factory Relax-Day Foot Mask Maska za Stopala'),
(33, 'rs', '33', 'Relax Day Hand Mask - Maska za Ruke', 'relax-day-hand-mask-maska-za-ruke', 'Relax Day Hand Mask', '<p>Relax Day maska za ruke sa Aqua Butter kompleksom oporavlja suve ruke čineći ih ponovo mekim i glatkim.</p>\r\n<p>Redovnom upotrebom Relax Day maske Vaše ruke biće nežnije, mekše i hidrirane.</p>\r\n<h2>Zašto je Relax-Day maska za ruke bolja od sličnih proizvoda?</h2>\r\n<p><strong>1.</strong> Relax-day maska za ruke ima kremastu formulu koja nije lepljiva.<br /><strong>2.</strong> Obogaćena je <strong>Aqua Butter kompleksom</strong> sa <strong>Aloe Butter-om ™</strong> , koji sadrži ekstrakt aloje i ulje kokosa, i <strong>Rose Butter-om ™</strong> koji sadrži ulje kokosa, palmino kernel ulje i ulje ruže Damaska. Ovi pažljivo odabrani, čisti i nerazblaženi nutrijenti oporavljaju suvu kožu.<br /><strong>3</strong>.Tajni sastojak Relax-Day maske za ruke je <strong>koren đavolje kandže</strong> - retka biljka koja se od davnina koristi od strane afričkih starosedelaca za ublažavanje bola i zaceljenje rana. Đavolja kandža je vrlo retka i ugrožena biljka, te se jedino može brati u limitiranim količinama.<br /><strong>4.</strong> Do baby mekanih ruku za samo 20 minuta.</p>\r\n<h3>Upotreba</h3>\r\n<p>Oprati ruke i staviti rukavice koje su obložene serumom. Zategnuti ih sa tračicama oko zglobova. Nakon 15-20 minuta skinuti rukavice, a preostali serum utrljati.</p>', NULL, NULL, '', '', '', '', ''),
