(34, 'rs', '34', 'Relax Day Body Oil Wash - Pena za Kupanje', 'relax-day-body-oil-wash-pena-za-kupanje', 'Relax Day Body Oil Wash', '<h2>Opis proizvoda</h2>\r\n<p>Dvoslojni Body Oil Wash je jedinstveni proizvod za tuširanje i negu tela obogaćen Aqua Butter kompleksom, negujućim uljima i ekstraktima za hidrataciju.</p>\r\n<h3>Zašto je Relax-Day Body Oil Wash bolji od ostalih proizvoda za tuširanje?</h3>\r\n<p><strong>1.</strong> Dvoslojna Body Oil + Body Wash formula, koja u sebi sadrži ulje za telo i nežno sredstvo za tušuranje bogato penom,  čisti telo i uklanja nečistoće, hidrira i hrani kožu ostavljajući je mekom na dodir.<br /><strong>2.</strong> <strong>Aqua Butter kompleks</strong> sa <strong>Aloe Butter-om ™</strong> i <strong>Rose Butter-om ™</strong> obogaćuje suvu kožu čistim i nerazblaženim sastojcima.<br /><strong>3.</strong> <strong>Ulja</strong> i <strong>ekstrakti za hidrataciju</strong> čine kožu zdravom, mekom i glatkom.</p>\r\n<h4>Upotreba</h4>\r\n<p><strong>1.</strong> Promućkati flašicu 2 do 3 puta kako bi se slojevi pomešali.<br /><strong>2.</strong> Sredstvo utrljati u kožu rukom ili uz pomoć sunđera za tuširanje.<br /><strong>3.</strong> Isprati sa vodom.<br /><br />Pakovanje: 300 ml </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Relax Day Body Oil Wash Pena za Kupanje', '', 'Village 11 Factory Relax Day Body Oil Wash korejska Pena za Kupanje ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Relax Day Body Oil Wash Pena za Kupanje', 'Village 11 Factory Relax Day Body Oil Wash Pena za Kupanje'),
(35, 'rs', '35', 'Relax Day Body Oil Cream - Krema za Telo ', 'relax-day-body-oil-cream-krema-za-telo', 'Relax Day Body Oil Cream', '<h2>Opis proizvoda</h2>\r\n<p>Relax-Day Body Oil krema za telo može se koristi za negu “od glave do pete”. Ova bogata krema hrani i oporavlja suvu kožu, činići je sjajnom i baby mekom uz 3 magična sastojka:</p>\r\n<ol>\r\n<li><strong>Aqua Butter</strong> kompleks koji u sebi sadrži <strong>Aloe Butter</strong> (ekstrakt aloje i ulje kokosa) i <strong>Rose Butter</strong> (ulje kokosa, palmino kernel ulje i ulje ruže Damaska)</li>\r\n<li><strong>Shea Butter</strong> (20%)</li>\r\n<li>Tajni sastojak brenda Village 11 Factory – <strong>ekstrakt korena đavolje kandže</strong> - poznate biljke iz porodice susama koja se koristi za obnovu i vitalnost kože. Afrički starosedeoci je od davnina koriste za ublažavanje bola i zaceljenje rana.</li>\r\n</ol>\r\n<h3>Zašto je Relax-Day Body Oil Krema bolja od ostalih krema za negu tela?</h3>\r\n<p>1. Kreirana je da formira tanak sloj na koži koji je nelepljiv i zadržava mekoću duže vreme.<br />2. Sadrži pažljivo odabrane, čiste i nerazblažene nutrijente koji oporavljaju suvu kožu.</p>\r\n<h4>Upotreba</h4>\r\n<p>Naneti na čistu kožu, koja je osušena peškirom, nežnim pokretima, blago masirajući kožu. Ponovo naneti kad god osetite da Vam je koža suva.<br /><br />Pakovanje:  200 ml</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Village 11 Factory Relax Day Body Oil Cream Krema za Telo ', '', 'Village 11 Factory Relax Day Body Oil Cream korejska Krema za Telo  ekskluzivno u Amorina Cosmetics', 'Village 11 Factory Relax Day Body Oil Cream Krema za Telo ', 'Village 11 Factory Relax Day Body Oil Cream Krema za Telo'),
(82, 'rs', '82', 'Dessert à Lèvres - Ruž za usne Crème Caramel', 'dessert-a-levres-ruz-za-usne-creme-caramel', 'Dessert à Lèvres', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>Dessert à Lèvres je ruž za usne sa kremastim finishem. Obogaćen je shea buterom koji štiti i neguje usne, i ima delikatan cupcakes miris što čini da apliciranje karmina bude pravo uživanje. </p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Crème Caramel</strong></span> je neodoljivo sofisticirana boja, srednje karamel nude nijansa sa toplim cimet podtonom.  </p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p style=\"text-align: justify;\">Dessert à Lèvres ima velvet finish i punu prekrivenost već sa prvim nanošenjem. Ukoliko želite dodatni mat finish stavite maramicu na usne i pritisnite je usnama.</p>\r\n<h4 style=\"text-align: center;\">Po čemu se Dessert à Lèvres razlikuje?</h4>\r\n<p>✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet </p>\r\n<p>Pakovanje: 4 ml.</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Dessert à Lèvres Ruž za usne Crème Caramel', '', 'Neve Cosmetics Dessert à Lèvres veganski Ruž za usne Crème Caramel ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Dessert à Lèvres Crème Caramel Ruž za usne ', 'Neve Cosmetics Dessert à Lèvres Crème Caramel Ruž za usne vegan'),
(37, 'rs', '37', 'Creamy Comfort Foundation – Tečni Puder Light Neutral', 'creamy-comfort-foundation-tecni-puder-light-neutral', 'Creamy Comfort Foudation', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>Negujući kremasti puder Creamy  Comfort Foundat<br></p>', NULL, NULL, 'Neve Cosmetics Creamy Comfort Foundation Tečni Puder Light Neutral', '', 'Neve Cosmetics Creamy Comfort Foundation veganski Tečni Puder Light Neutral ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Creamy Comfort Foundation Tečni Puder Light Neutral', 'Neve Cosmetics Creamy Comfort Foundation Tečni Puder Light Neutral vegan'),
(38, 'rs', '38', 'Tečni Puder Medium Neutral', 'tecni-puder-medium-neutral', 'Creamy Comfort Foundation', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>Negujući kremasti puder Creamy  Comfort Foundation je obogaćen jojoba uljem i hijaluronskom kiselinom. Formula bez silikona sa pažljivo biranim sastojcima pogodna je i za vegetarijance i vegane i prijatna je za svakodnevno nanošenje. </p>\r\n<p>Nijansa <span style=\"color: #cc99ff;\"><strong>Medium Neutral</strong> </span>je srednja nijansa sa neutralnim podtonovima i pogodna je za kožu koja nije ni svetla ni tamna. Savršena je za Vas koji možete lako da pocrnite, ali nemate previše mediteranski ten. Ako je Vaš ten “normalan” (nije ni svetao ni taman, kao ni rozikav ni maslinast) onda je ovo nijansa za Vas.</p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Creamy Comfort Foundation može da se nanosi prstima, kao da je krema za lice, lagano masirajući dok proizvod ne upije, a mineralni pigmenti ne odrade svoju magiju. Mala količina proizvoda je dovoljna da prekrije celo lice. </p>\r\n<p>Creamy Comfort Foundation  ima neuralni finish, te predstavlja savršenu bazu za rumenila, bronzere, hajlajtere i pudere u prahu ili kamenu.</p>\r\n<p> Lako se skida koristeći jednostavan cleanser za čišćenje. Naša preporuka je da pogledate naš <a href=\"https://amorinacosmetics.com/proizvodi/moisture-cleansing-foam-pena-za-ciscenje-lica/\">Village 11 Factory Moisture Cleansing Foam </a> penu za čišćenje lica.</p>\r\n<h4 style=\"text-align: center;\">Zašto izabrati Creamy Comfort Foundation?</h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p>Pakovanje: 30ml</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, '', '', '', '', ''),
(39, 'rs', '39', 'Tečni Puder Tan Neutral', 'tecni-puder-tan-neutral', 'Creamy Comfort Foundation', '<p>Negujući kremasti puder Creamy  Comfort Foundation je obogaćen jojoba uljem i hijaluronskom kiselinom. Formula bez silikona sa pažljivo biranim sastojcima pogodna je i za vegetarijance i vegane i prijatna je za svakodnevno nanošenje. </p>\r\n<p>Nijansa <span style=\"color: #cc99ff;\"><strong>Tan Neutral</strong> </span>je tamna nijansa sa neutralnim podtonovima. Predstavlja prirodnu boju za preplanulu ili tamnu kožu koja nema preterano izrazen zlatkasti ili mastlinas mediteranski podton. Pogodna je takođe za potamnjivanje ostalih svetlijih nijansa pudera.</p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Creamy Comfort Foundation može da se nanosi prstima, kao da je krema za lice, lagano masirajući dok proizvod ne upije, a mineralni pigmenti ne odrade svoju magiju. Mala količina proizvoda je dovoljna da prekrije celo lice. </p>\r\n<p>Creamy Comfort Foundation  ima neuralni finish, te predstavlja savršenu bazu za rumenila, bronzere, hajlajtere i pudere u prahu ili kamenu.</p>', NULL, NULL, '', '', '', '', ''),
