(158, 'rs', '158', 'BOSCH Šrafilica', 'bosch-srafilica', NULL, '<p>Ovo je probna šrafilica za Bosch...</p>', NULL, NULL, NULL, '', NULL, NULL, NULL),
(40, 'rs', '40', 'Puder u Kamenu Light Neutral', 'puder-u-kamenu-light-neutral', 'Flat Perfection Foundation', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>Puder u kamenu sa veganskom I vegetarijanskom forumulom bez silikona. Dragoceni minerali su kombinovani sa biljnim sastojcima I vitaminima koji daju koži gladak, sjajan izgled čineći je sublimnom na izgled I dodir.</p>\r\n<p>Nijansa <span style=\"color: #cc99ff;\"><strong>Light Neutral</strong></span> je najsvetlija nijansa sa neutralnim podtonovima koja nema  ni izražen žuti niti roze ton.  Posebno je pogodna za svetliju kožu i poznata je po tome što pristaje skoro svima, pogotovo tokom zimskim meseci. Ako imate svetao ten koji ne crni lako, onda je ovo nijansa za Vas. </p>\r\n<h3 style=\"text-align: center;\"><span style=\"font-size: 1.17em; text-align: center;\">Beauty Saveti</span></h3>\r\n<p>Flat Perfection se nanosi vrlo brzo I jednostavno. Za prirodan efekat koristiti sintetičku četku i sa njom naneti malu količinu proizvoda koristeći kružne pokrete.</p>\r\n<p>Ukoliko želite veću prikrivenost, naneti malo vode ili makeup sprej na četkicu sa puderom.</p>\r\n<p>Zanimljiva činjenica: Dizajn Flat Perfection je baziran na konceptu harmonije i glatkosti. Inspiraciju za minimalističko pakovanje Dizajneri pudera dobili posmatrajući polirano kamenje iz Zen bašti.</p>\r\n<h4 style=\"text-align: center;\">Po čemu se Flat Perfection Foundation izdvaja?</h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet </p>\r\n<p>Pakovanje: 8g proizvoda i pakovanje prečnika 5,8 cm.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, '', '', '', '', ''),
(41, 'rs', '41', 'Puder u Kamenu Medium Neutral', 'puder-u-kamenu-medium-neutral', 'Flat Perfection Foundation', '<p>Puder u kamenu sa veganskom i <strong>vegetarijanskom</strong> <em>forumulom</em> bez silikona. Dragoceni minerali su <span style=\"font-size: 36pt;\">kombinovani</span> sa biljnim sastojcima I vitaminima koji daju koži gladak, sjajan izgled čineći je sublimnom na izgled I dodir.</p>\r\n<p>Nijansa <span style=\"color: #cc99ff;\"><strong>Medium Neutral</strong></span> je srednja nijansa sa neutralnim podtonovima i pogodna je za kožu koja nije ni svetla ni tamna. Savršena je za Vas koji možete lako da pocrnite, ali nemate previše mediteranski ten. Ako je Vaš ten “normalan” (nije ni svetao ni taman, kao ni rozikav ni maslinast) onda je ovo nijansa za Vas.</p>\r\n<h3 style=\"text-align: center;\">Beauty Saveti</h3>\r\n<p> Flat Perfection se nanosi vrlo brzo I jednostavno. Za prirodan efekat koristiti sintetičku četku i sa njom naneti malu količinu proizvoda koristeći kružne pokrete.</p>', NULL, NULL, '', '', '', '', ''),
