međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Nascondino Double Precision Concealer korektor u olovci Medium', '', 'Neve Cosmetics Nascondino Double Precision Concealer veganski korektor u olovci Medium ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Nascondino Double Precision Concealer Korektor u Olovci Medium', 'Neve Cosmetics Nascondino Double Precision Concealer Korektor u Olovci Medium vegan'),
(45, 'rs', '45', 'Nascondino Double Precision Concealer - Korektor u Olovci Light', 'nascondino-double-precision-concealer-korektor-u-olovci-light', 'Nascondino Double Precision Concealer', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Nascondino Double Precision Concealer je 2 u 1 korektor sa dve nijanse i dva ”vrha” olovke različite veličine i teksture. Koristiti kremasti, deblji vrh olovke za ujednačavanje tena i predela oko očiju, a drugi, tanji vrh olovke za precizno prekrivanje bubuljica i nesavršenosti. </span></p>\r\n<p>Nijansa<span style=\"color: #cc99ff;\"><strong> Light</strong></span> je nijansa pogodna za ten svetlijih do srednje tamnih nijansa.</p>\r\n<h3 style=\"text-align: center;\">Beauty Saveti</h3>\r\n<p><span>Nije pravilno prekrivati sve nesavršenosti na licu na isti način. Nascondino korektor iz tog razloga ima dva vrha:</span></p>\r\n<p><span>1. <span style=\"color: #cc99ff;\"><strong>“Creamy Coverage”</strong></span> kremast vrh olovke toplog tona koji je savršen za prekrivanje podočnjaka i ujednačavanje predela oko očiju.<br /></span>2. <span style=\"color: #cc99ff;\"><strong>“Total Accuracy”</strong></span> precizan vrh olovke koji je super-mat i kompaktan za totalno preciznu i malu korekciju bubuljica, tragova i flekica od bubuljica i sličnih nesavršenosti.</p>\r\n<h4 style=\"text-align: center;\">Po čemu se Nascondino korektor izdvaja?</h4>\r\n<p><span>✩ </span>2 u 1 korektor sa dva vrha<br />✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p>Pakovanje: Drvena olovka sa dva vrha, dijametar 10,5 mm, dužina 120mm.Sadržaj: Total Accuracy deo olovke 0,7g, dijametar 4 mm - Creamy Coverage deo olovke 2,1 g, dijametar 7 mm.</p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Nascondino Double Precision Concealer Korektor u Olovci Light', '', 'Neve Cosmetics Nascondino Double Precision Concealer veganski Korektor u Olovci Light ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Nascondino Double Precision Concealer Korektor u Olovci Light', 'Neve Cosmetics Nascondino Double Precision Concealer Korektor u Olovci Light vegan'),
(46, 'rs', '46', 'Ombraluce Mineral Contouring Kit - Bronzer & Hajlajter set', 'ombraluce-mineral-contouring-kit-bronzer-hajlajter-set', 'Ombraluce Mineral Contouring Kit', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Ombraluce Mineral Contouring Kit čine dva mineralna pudera (bronzer i hajlajter) koji se lako blenduju i služe za konturisanje i hajlajtovanje lica. Sa Ombraluce setom nikad nije bilo lakše biti sam svoj makeup artist.  </span></p>\r\n<p><span>Ombraluce Mineral Contouring Kit se sastoji od:<br /></span>1. <span style=\"color: #cc99ff;\"><strong>Ombraluce Light</strong></span> hajlajtera koji je u formi transparentnog, iluminantnog pudera koji služi za isticanje željenih delova lica.<span><br /></span>2. <span style=\"color: #cc99ff;\"><strong>Ombraluce Shadow</strong></span> bronzera koji je u formi mat neutralnog pudera koji apsorbuje svetlost i vizuelno kreira “udubljenja” i time definiše i oblikuje lice. </p>\r\n<p><span>Ombraluce Kit je profesionalno formulisan proizvod koji se adaptira svakoj boji kože.</span></p>\r\n<h3 style=\"text-align: center;\"><span>Beauty saveti</span></h3>\r\n<p>Koristiti oba mineralna pudera u kombinaciji za potpuni efekat. Može se nanositi na suv ili mokar način.</p>\r\n<h4 style=\"text-align: center;\"><span style=\"font-size: 1em; text-align: center;\">  Po čemu se Ombraluce Mineral Contouring Kit razlikuje?</span></h4>\r\n<p><span>✩</span><span> Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br /></span>✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p>Pakovanje: Dve zasebne kutijice sa po 4 g proizvoda. Sifter za lakse korišćenje proizvoda se nalazi u pakovanju. </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<div><span><br /></span></div>', NULL, NULL, 'Neve Cosmetics Ombraluce Mineral Contouring Kit Bronzer Hajlajter set', '', 'Neve Cosmetics Ombraluce veganski set bronzer i hajlajter ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Ombraluce Mineral Contouring Kit Bronzer i Hajlajter set', 'Neve Cosmetics Ombraluce Mineral Contouring Kit Bronzer i Hajlajter set vegan'),
(47, 'rs', '47', 'Single Blush - Rumenilo Passion Fruit ', 'single-blush-rumenilo-passion-fruit', 'Single Blush', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Kompaktna nijansa u panu. Čisti pigmenti i formula obogaćena vitaminima obezbeđuju dugotrajan komfort i pokrivenost.</span></p>\r\n<p><span><span style=\"color: #cc99ff;\"><strong>Passion Fruit</strong></span> je bež roze boja sa mavenim podtonom i delikatnim satin sjajem. </span><span>Možete adaptirati intenzitet boje u zavisnosti od broja nanošenja.</span></p>\r\n<h3 style=\"text-align: center;\"><span>Beauty saveti</span></h3>\r\n<p><span>Pogodan je za suvu i mokru aplikaciju. <br /><br />Savetujemo Vam da pogledate <span style=\"color: #cc99ff;\"><strong>4 Holes Palete Lemon Light</strong></span> i <strong><span style=\"color: #cc99ff;\">Violet Vision</span></strong> za odlaganje vaših senki i rumenila.</span></p>\r\n<h4 style=\"text-align: center;\"><span>Po čemu se Single Blush rumenilo razlikuje?</span></h4>\r\n<p><span>✩</span><span> Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br /></span>✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet </p>\r\n<p><span>Pakovanje: 3 g proizvoda u panu dijametra 3,6 cm.</span></p>\r\n<div style=\"text-align: justify;\"><span><br /></span></div>\r\n<div style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></div>', NULL, NULL, 'Neve Cosmetics Single Blush Rumenilo Passion Fruit ', '', 'Neve Cosmetics Single Blush vegansko Rumenilo Passion Fruit ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Single Blush Rumenilo Passion Fruit ', 'Neve Cosmetics Single Blush Rumenilo Passion Fruit vegan'),
(48, 'rs', '48', 'Single Blush - Rumenilo Pill', 'single-blush-rumenilo-pill', 'Single Blush', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>Kompaktna nijansa u panu. Čisti pigmenti i formula obogaćena vitaminima obezbeđuju dugotrajan komfort i pokrivenost.</p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Pill</strong></span> je koralna aprikot nijansa sa mat finishem. Možete adaptirati intenzitet u zavisnosti od broja nanošenja. </p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Pogodan je za suvu i mokru aplikaciju. <br /><br />Savetujemo Vam da pogledate <strong><span style=\"color: #cc99ff;\">4 Holes Palete Lemon Light</span></strong> i <span style=\"color: #cc99ff;\"><strong>Violet Vision</strong></span> za odlaganje vaših senki i rumenila.</p>\r\n<h4 style=\"text-align: center;\">Po čemu se Single Blush rumenilo razlikuje?</h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p> Pakovanje: 3 g proizvoda u panu dijametra 3,6 cm.</p>\r\n<div style=\"text-align: justify;\"> </div>\r\n<div style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></div>', NULL, NULL, 'Neve Cosmetics Single Blush Rumenilo Pill', '', 'Neve Cosmetics Single Blush vegansko Rumenilo Pill ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Single Blush Rumenilo Pill', 'Neve Cosmetics Single Blush Rumenilo Pill vegan'),
(54, 'rs', '54', 'Pastello Eyeliner - Olovka za oči Piuma', 'pastello-eyeliner-olovka-za-oci-piuma', 'Pastello Eyeliner ', '<p>Pastello Eyeliner se veoma lako blenduje i može se koristi kao ajlajner, senka, baza za senke i kao olovka za oči. </p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Piuma</strong></span> je klasična bela boja sa mat finishem.</p>', NULL, NULL, '', '', '', '', ''),
(49, 'rs', '49', 'Single Blush - Rumenilo Nowhere ', 'single-blush-rumenilo-nowhere', 'Single Blush', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Kompaktna nijansa u panu. Čisti pigmenti i formula obogaćena vitaminima obezbeđuju dugotrajan komfort i pokrivenost.</span></p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Nowhere </strong></span>je topla nude breskva nijansa sa bež podtonom i velvet finishem. Možete adaptirati intenzitet boje u zavisnosti od broja nanošenja.</p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p><span>Pogodan je za suvu i mokru aplikaciju. </span></p>\r\n<p><span>Savetujemo Vam da pogledate <span style=\"color: #cc99ff;\"><strong>4 Holes Palete Lemo</strong></span><span style=\"color: #cc99ff;\"><strong>n</strong><strong> Light</strong></span> i <span style=\"color: #cc99ff;\"><strong>Violet Vision</strong></span> za odlaganje vaših senki i rumenila.</span></p>\r\n<h4 style=\"text-align: center;\"> Po čemu se Single Blush rumenilo razlikuje?</h4>\r\n<p><span>✩</span><span> Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br /></span>✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet </p>\r\n<p><span>Pakovanje: 3 g proizvoda u panu dijametra 3,6 cm.</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Single Blush Rumenilo Nowhere ', '', 'Neve Cosmetics Single Blush vegansko Rumenilo Nowhere ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Single Blush Rumenilo Nowhere ', 'Neve Cosmetics Single Blush Rumenilo Nowhere vegan'),
(50, 'rs', '50', 'Single Blush - Rumenilo Escape ', 'single-blush-rumenilo-escape', 'Single Blush', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Kompaktna nijansa u panu. Čisti pigmenti i formula obogaćena vitaminima obezbeđuju dugotrajan komfort i pokrivenost.</span></p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Escape</strong></span> je  živopisno svetlo koralno roze nijansa sa mat finishem. Možete adaptirati intenzitet boje u zavisnosti od broja nanošenja.</p>\r\n<h3 style=\"text-align: center;\"><span>Beauty saveti</span></h3>\r\n<p><span>Pogodan je za suvu i mokru aplikaciju.</span></p>\r\n<p><span>Savetujemo Vam da pogledate<span style=\"color: #cc99ff;\"><strong> 4 Holes Palete Lemon Light</strong></span> i <span style=\"color: #cc99ff;\"><strong>Violet Vision</strong></span> za odlaganje vaših senki i rumenila.</span></p>\r\n<h4 style=\"text-align: center;\"><span>Po čemu se Single Blush rumenilo razlikuje?</span></h4>\r\n<p><span>✩</span><span> Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br /></span>✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p>Pakovanje: 3 g proizvoda u panu dijametra 3,6 cm.</p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\"> </span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Single Blush Rumenilo Escape ', '', 'Neve Cosmetics Single Blush vegansko Rumenilo Escape ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Single Blush Rumenilo Escape ', 'Neve Cosmetics Single Blush Rumenilo Escape vegan'),
(51, 'rs', '51', 'Blush Garden - Rumenilo Monday Rose ', 'blush-garden-rumenilo-monday-rose', 'Blush Garden', '<p>Veoma lako za blendanje, Blush Garden rumenilo ima prirodan finish za prirodan, svež i velvet izgled Vaših obraza.</p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Monday Rose</strong></span> nijansa je bogata roze nijansa lubenice za  energičan, vedar izgled čak i ponedeljkom.</p>', NULL, NULL, '', '', '', '', ''),
(52, 'rs', '52', 'Blush Garden - Rumenilo Thursday Rose', 'blush-garden-rumenilo-thursday-rose', 'Blush Garden', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Veoma lako za blendanje, Blush Garden rumenilo ima prirodan finish za prirodan, svež i velvet izgled Vaših obraza. </span></p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Thursday Rose</strong></span> je živopisna nijansa breskve, neodoljiva kao četvrtak off work. ☺</p>\r\n<h3 style=\"text-align: center;\"><span>Beauty saveti</span></h3>\r\n<p><span>Blush Garden rumenilo možete nanositi na obraze prstima ili sa sintetičkom četkom.</span> </p>\r\n<h4 style=\"text-align: center;\"><span>Po čemu se Blush Garden rumenilo razlikuje?</span></h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p><span>Pakovanje: 4 ml</span></p>\r\n<div><span><br /></span></div>\r\n<div style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></div>', NULL, NULL, 'Neve Cosmetics Blush Garden Rumenilo Thursday Rose', '', 'Neve Cosmetics Blush Garden vegansko Rumenilo Thursday Rose ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Blush Garden Kremasto Rumenilo Thursday Rose', 'Neve Cosmetics Blush Garden Kremasto Rumenilo Thursday Rose vegan'),
(53, 'rs', '53', 'Blush Garden - Rumenilo Friday Rose ', 'blush-garden-rumenilo-friday-rose', 'Blush Garden', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Veoma lako za blendanje, Blush Garden kremasto rumenilo ima prirodan finish za prirodan, svež i velvet izgled Vaših obraza. </span></p>\r\n<p><span><span style=\"color: #cc99ff;\"><strong>Friday Rose</strong></span> je prirodno tamno roze bež nijansa, misteriozna i sofisticirana kao petak veče.</span><span> ☺</span></p>\r\n<h3 style=\"text-align: center;\"><span>Beauty saveti</span></h3>\r\n<p><span>Blush Garden rumenilo možete nanositi na obraze prstima ili sa sintetičkom četkom.</span></p>\r\n<h4 style=\"text-align: center;\"><span>Po čemu se Blush Garden rumenilo razlikuje?</span></h4>\r\n<p><span>✩</span><span> Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br /></span>✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet </p>\r\n<p><span>Pakovanje: 4 ml</span></p>\r\n<p><span><br /></span></p>\r\n<p style=\"text-align: justify;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<p> </p>\r\n<p> </p>', NULL, NULL, 'Neve Cosmetics Blush Garden Rumenilo Friday Rose ', '', 'Neve Cosmetics Blush Garden vegansko Rumenilo Friday Rose ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Blush Garden Kremasto Rumenilo Friday Rose ', 'Neve Cosmetics Blush Garden Kremasto Rumenilo Friday Rose vegan'),
(55, 'rs', '55', 'Pastello Eyeliner - Olovka za oči Terra', 'pastello-eyeliner-olovka-za-oci-terra', 'Pastello Eyeliner', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p><span>Pastello Eyeliner se veoma lako blenduje i može se koristi kao ajlajner, senka, baza za senku i kao olovka za oči. </span></p>\r\n<p><span><span style=\"color: #cc99ff;\"><strong>Terra</strong></span> je srednje braon nijansa sa nežnim zlatnim satenskim sjajem. Savršena za kreiranje prirodnog look-a.</span></p>\r\n<h3 style=\"text-align: center;\"><span>Beauty Saveti</span></h3>\r\n<p><span>Pastello Eyeliner se može koristiti kao:</span></p>\r\n<p><span>1.<span style=\"color: #cc99ff;\"><strong> Olovka za oči</strong></span> koju možete staviti oko oboda očiju. Svetle nijanse čine oči vizuelno većim, dok tamnije nijanse oblikuju i definišu oblik očiju.<br /></span>2. <span style=\"color: #cc99ff;\"><strong>Baza</strong></span> preko celog kapka, tako što ćete je izblendati sa mekom četkicom i nakon toga natapkati željenu senku ili pigment.<br />3. <span style=\"color: #cc99ff;\"><strong>Ajlajner</strong></span> za iscrtavanje linije na gornjem kapku. Možete izblendati liniju sa četkicom za ajlajner kako biste kreirali savršen look 60-tih.<br />4. <span style=\"color: #cc99ff;\"><strong>Senka</strong></span> za dodavanje definicije linije trepavica i prevoja oka i upotpunjavanje željenog look napr. Smookey Eyes. Naneti olovku uz liniju gornjih i donjih trepavica, kao i na prevoj oka i izblendovati sa mekom četkicom. </p>\r\n<h4 style=\"text-align: center;\"> Po čemu se Pastello Eyeliner razlikuje? </h4>\r\n<p><span>✩</span><span> Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br /></span>✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p> Pakovanje: drvena olovka dijamentra 7,5 mm, dužine 138 mm. Sadržaj: dijametar 4 mm, 1,50 g punjenja olovke</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<div><span><br /></span></div>', NULL, NULL, 'Neve Cosmetics Pastello Eyeliner Olovka za oči Terra', '', 'Neve Cosmetics Pastello Eyeliner veganska Olovka za oči Terra ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Pastello Eyeliner Olovka za oči Terra', 'Neve Cosmetics Pastello Eyeliner Olovka za oči Terra vegan'),
