(63, 'rs', '63', 'Inkme Eyeliner - Tečni ajlajner Bastet', 'inkme-eyeliner-tecni-ajlajner-bastet', 'Inkme Eyeliner', '<h2 align=\"center\">Opis proizvoda</h2>\r\n<p>Inkme Eyeliner je ajlajner na bazi vode, lako se nanosi uz aplikator i ima mat finish.</p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Bastet</strong> </span>je najtamnija crna nijansa, savršena za cat eye look. </p>\r\n<h3 align=\"center\">Beauty saveti </h3>\r\n<p>Inkme Eyeliner se bez problema skida sredstvima za skidanje šminke.</p>\r\n<h4 align=\"center\">Po čemu se Inkme Eyeliner razlikuje?</h4>\r\n<p>✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet </p>\r\n<p>Pakovanje: 4 ml</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<p> </p>', NULL, NULL, 'Neve Cosmetics Inkme Eyeliner Tečni ajlajner Bastet', '', 'Neve Cosmetics Inkme Eyeliner veganski Tečni ajlajner Bastet ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Inkme Eyeliner Tečni ajlajner Bastet', 'Neve Cosmetics Inkme Eyeliner Tečni ajlajner Bastet vegan'),
(64, 'rs', '64', 'Manga Brows - Olovka za obrve Warm Blonde & Soft Brown', 'manga-brows-olovka-za-obrve-warm-blonde-soft-brown', 'Manga Brows', '<h2 align=\"center\">Opis proizvoda</h2>\r\n<p style=\"text-align: left;\" align=\"center\">Definisanje obrva može biti zabavno i jednostavno uz Manga Brows!<br />Specijalna olovka za obrve dizajnirana sa dva vrha i sa profesionalnom četkicom i savršena je za kreiranje prirodno definisanih obrva.</p>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"color: #cc99ff;\"><strong>Warm Blonde &amp; Soft Brown</strong></span> je nijansa pogodna je za medno plavu, toplu i kestenjastu braon kosu.</p>\r\n<h3 align=\"center\">Beauty saveti </h3>\r\n<p style=\"text-align: left;\" align=\"center\">Koristiti svetliju stranu olovke za iscrtavanje željenog oblika obrva, a tamniji stranu za dodavanje definicije i popunjavanje praznina laganim potezima. Pročešljati obrve ka spolja koristeći Manga Brows četkicu. </p>\r\n<h4 style=\"text-align: center;\" align=\"center\">Po čemu se razlikuje?</h4>\r\n<p>✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet </p>\r\n<p>Pakovanje: drvena olovka sa dva vrha, dijametra 7,5 mm, dužine 120 mm</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Manga Brows Olovka za obrve Warm Blonde Soft Brown', '', 'Neve Cosmetics Manga Brows veganska Olovka za obrve Warm Blonde Soft Brown ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Manga Brows Olovka za obrve Warm Blonde Soft Brown', 'Neve Cosmetics Manga Brows Olovka za obrve Warm Blonde Soft Brown vegan'),
(65, 'rs', '65', 'Manga Brows - Olovka za obrve Rich Brown & Black Brown', 'manga-brows-olovka-za-obrve-rich-brown-black-brown', 'Manga Brows', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p style=\"text-align: left;\" align=\"center\">Definisanje obrva može biti zabavno i jednostavno uz Manga Brows!<br />Specijalna olovka za obrve dizajnirana sa dva vrha i sa profesionalnom četkicom i savršena je za kreiranje prirodno definisanih obrva.</p>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"color: #cc99ff;\"><strong>Rich Brown &amp; Black Brown</strong></span> je nijansa pogodna je za tamno braon i mahagoni smeđu kosu, kao i za ostale brinete. </p>\r\n<h3 style=\"text-align: center;\" align=\"center\">Beauty saveti</h3>\r\n<p style=\"text-align: left;\" align=\"center\">Koristiti svetliju stranu olovke za iscrtavanje željenog oblika obrva, a tamniji stranu za dodavanje definicije i popunjavanje praznina laganim potezima. Pročešljati obrve ka spolja koristeći Manga Brows četkicu. </p>\r\n<h4 style=\"text-align: center;\" align=\"center\">Po čemu se Manga Brows razlikuje?</h4>\r\n<p style=\"text-align: left;\">✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet</p>\r\n<p style=\"text-align: left;\"> Pakovanje: drvena olovka sa dva vrha, dijametra 7,5 mm, dužine 120 mm.</p>\r\n<p style=\"text-align: left;\"> </p>\r\n<p style=\"text-align: left;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, '', '', '', '', ''),
