(67, 'rs', '67', 'Black Bubble Mascara - Maskara za Volumen', 'black-bubble-mascara-maskara-za-volumen', 'Black Bubble Mascara', '<h2 style=\"text-align: center;\" align=\"center\">Opis proizvoda</h2>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"color: #cc99ff;\"><strong>Black Bubble Mascara</strong> </span>je maskara za neverovatan, intenzivan volumen koja je specijalno formulisana: produžava i podiže trepavice i čini ih super crnim bez osećaja težine na trepavicama.</p>\r\n<p style=\"text-align: left;\">Sadrži posebno odabrane sastojke: dosta crnog pigmeta za isticanje trepavica, celulozu za volumen, jojoba ulje i akaciju za elastičnost, vosak voća myrica za strukturu i ulje semenke jagode koje ima rekonstruktivni efekat.</p>\r\n<p style=\"text-align: left;\">Četkica maskare, forme peščanog sata, je posebno dizajnirana za nanošenje više slojeva maskare dok nežno podiže trepavice.</p>\r\n<h3 style=\"text-align: center;\" align=\"center\">Beauty saveti </h3>\r\n<p style=\"text-align: left;\" align=\"center\">Idealna za najdramatičnije make-up look-ove.</p>\r\n<h4 style=\"text-align: center;\" align=\"center\">Po čemu se Black Bubble Mascara razlikuje?</h4>\r\n<p style=\"text-align: left;\">✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p style=\"text-align: left;\">Pakovanje: 8,5 ml</p>\r\n<p style=\"text-align: left;\"> </p>\r\n<p style=\"text-align: left;\"><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Black Bubble Maskara za Volumen', '', 'Neve Cosmetics Black Bubble veganska Maskara za Volumen ekskluzivno u Amorina Cosmetics', 'Black Bubble Mascara Maskara za Volumen', 'Black Bubble Mascara Maskara za Volumen vegan'),
(68, 'rs', '68', 'DeerLash defining Mascara - Maskara Bambi', 'deerlash-defining-mascara-maskara-bambi', 'DeerLash defining Mascara', '<h2 align=\"center\">Opis proizvoda</h2>\r\n<p style=\"text-align: left;\" align=\"center\"><span style=\"color: #cc99ff;\"><strong>Deerlash defining Mascara</strong></span> je inspirisana očaravajućom elegancijom srne i čini trepavice dugačkim i definisanim, a pogled zadivljujućim, zavodničkim i sofisticiranim.<br /><br />Deerlash maskara je napravljena od prirodnih sastojaka kao što su vosak semenke suncokreta i pigmenti ekstraktovani od uglja Ubame hrasta. Iz tog razloga, Deerlash maskara čini trepavice dugačkim i sjajnim, a u istovremeno fleksibilnim i \"lepršavim\". </p>\r\n<p>Četkica razdvaja trepavice i ravnomerno nanosi maskaru za pravi \"Bambi pogled\".</p>\r\n<h3 align=\"center\">Beauty saveti</h3>\r\n<p>Lako se skida nežnim sredstvom za skidanje šminke i mlakom vodom.</p>\r\n<h4 style=\"text-align: center;\"> Po čemu se Deerlash defining Mascara razlikuje?</h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet </p>\r\n<p>Pakovanje: 10,5 ml</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics DeerLash defining Maskara Bambi', '', 'Neve Cosmetics DeerLash defining veganska Maskara Bambi ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics DeerLash defining Mascara Maskara Bambi ', 'Neve Cosmetics DeerLash defining Mascara Maskara Bambi vegan'),
(69, 'rs', '69', 'Lippini Lipbalm - Balzam za usne Roseosèè', 'lippini-lipbalm-balzam-za-usne-roseosee', 'Lippini Lipbalm', '<h2 align=\"center\">Opis proizvoda </h2>\r\n<p><span style=\"color: #cc99ff;\"><strong>Roseosèè Lippini</strong> </span>je balzam nude nijanse, boje prirodno zdravih usana sa nežnim, velvet finishem i mirisom cvetanja ruža koji štiti usne i čini ih vizuelno savršenim. Sadrži ulje šipka koje je poznato po anti-aging svojstvima. </p>\r\n<p>Lippini su balzami koji usnama pružaju sjaj, elegantnu boju, negu i zaštitu. Kakao puter, vosak suncokreta i shea puter koji se nalaze u balzamu omogućavaju glatko nanošenje bez lepljivog osećaja. </p>\r\n<p>Lippini su savršeni izbor za vas ako volite prirodan \"Your lips but better\" look i sveže i hidrirane usne. </p>\r\n<h3 style=\"text-align: center;\"> Beauty saveti</h3>\r\n<p>Mogu se nanositi u bilo kojoj prilici, čak i pred spavanje ako želite da se probudite sa najmekšim usnama. Mogu se nanositi samostalno za prirodan izgled usana ili kao priprema pre nanošenja karmina, olovke ili sjaja za usne. </p>\r\n<h4 style=\"text-align: center;\">Po čemu se Lippini razlikuju?</h4>\r\n<p>✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet</p>\r\n<p>Pakovanje: 3,5 ml</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>', NULL, NULL, 'Neve Cosmetics Lippini Balzam za usne Roseosèè', '', 'Neve Cosmetics Lippini veganski Balzam za usne Roseosèè ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Lippini Labelo Balzam za usne Roseosèè', 'Neve Cosmetics Lippini Labelo Balzam za usne Roseosèè vegan'),
(70, 'rs', '70', 'Lippini Lipbalm - Balzam za usne Sweetsoleil', 'lippini-lipbalm-balzam-za-usne-sweetsoleil', 'Lippini Lipbalm', '<h2 align=\"center\">Opis proizvoda</h2>\r\n<p><span style=\"color: #cc99ff;\"><strong>Sweetsoleil Lippini</strong></span> je balzam  za usne sa sjajem koji vam pruža osećaj da ste na odmoru na tropskom ostrvu. Nežan zlatni sjaj osvežava i obasjava usne, čineći ih vizuelno punijim dok ih ekstrakt nevena umiruje i usne čini mekanim, nežnim i glatkim. Sweetsoleil balzam miriše na Karipsku plažu, amber vanilu i kokos.</p>\r\n<p>Lippini su balzami koji usnama pružaju sjaj, elegantnu boju, negu i zaštitu. Kakao puter, vosak suncokreta i shea puter koji se nalaze u balzamu omogućavaju glatko nanošenje bez lepljivog osećaja. </p>\r\n<p>Lippini su savršeni izbor za vas ako volite prirodan \"Your lips but better\" look i sveže i hidrirane usne.  </p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Mogu se nanositi u bilo kojoj prilici, čak i pred spavanje ako želite da se probudite sa najmekšim usnama. Mogu se nanositi samostalno za prirodan izgled usana ili kao priprema pre nanošenja karmina, olovke ili sjaja za usne.</p>\r\n<h4 style=\"text-align: center;\">Po čemu se razlikuje?</h4>\r\n<p>✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet </p>\r\n<p>Pakovanje: 3,5 ml</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Lippini Balzam za usne Sweetsoleil', '', 'Neve Cosmetics Lippini veganski Balzam za usne Sweetsoleil ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Lippini Labelo Balza