(71, 'rs', '71', 'Lippini Lipbalm - Balzam za usne Candysoft', 'lippini-lipbalm-balzam-za-usne-candysoft', 'Lippini Lipbalm', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p><span style=\"color: #cc99ff;\"><strong>Candysoft Lippini</strong></span> je negujući i umirujući balzam za usne sa uljem kajsije koji čini usne baršunastim. Candysoft miriše na cveće, bombone i zrelo voće. </p>\r\n<p>Lippini su balzami koji usnama pružaju sjaj, elegantnu boju, negu i zaštitu. Kakao puter, vosak suncokreta i shea puter koji se nalaze u balzamu omogućavaju glatko nanošenje bez lepljivog osećaja. </p>\r\n<p>Lippini su savršeni izbor za vas ako volite prirodan \"Your lips but better\" look i sveže i hidrirane usne. </p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Mogu se nanositi u bilo kojoj prilici, čak i pred spavanje ako želite da se probudite sa najmekšim usnama. Mogu se nanositi samostalno za prirodan izgled usana ili kao priprema pre nanošenja karmina, olovke ili sjaja za usne.</p>\r\n<h4 style=\"text-align: center;\">Po čemu se razlikuje?</h4>\r\n<p>✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet </p>\r\n<p>Pakovanje: 3,5 ml</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Lippini Balzam za usne Candysoft', '', 'Neve Cosmetics Lippini veganski Balzam za usne Candysoft ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Lippini Labelo Balzam za usne Candysoft', 'Neve Cosmetics Lippini Labelo Balzam za usne Candysoft vegan'),
