(80, 'rs', '80', 'Pastello Lipcolor - Olovka za Usne Vino', 'pastello-lipcolor-olovka-za-usne-vino', 'Pastello Lipcolor', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>Pastello Lipcolor kombinuje intenzitet karmina sa preciznošću olovke za usne. Veganska formula obogaćena dragocenim uljem i biljnim voskom.  Punoća boje, visoka pokrivenost i prijatnost tokom nošenja su zagarantovani. </p>\r\n<p><span style=\"color: #cc99ff;\"><strong>Vino</strong></span> je intenzivna, baršunasta boja šljive. </p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Možete ga koristiti za konturisanje usana, ali i za popunjavanje celih usana jer je Pastello Lipcolor zapravo karmin u formi olovke.</p>\r\n<h4 style=\"text-align: center;\">Po čemu se razlikuje Pastello Lipcolor?</h4>\r\n<p>✩Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩Bez silikona, petrolatuma i parabena<br />✩Cruelty free: nije testiran na životinjama<br />✩Made in Italy kvalitet </p>\r\n<p>Pakovanje: drvena olovka dijametra 7,5 mm, dužine 138 mm. Sadržaj dijametra 4 mm i 1,50 g punjenja.</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<p> </p>', NULL, NULL, 'Neve Cosmetics Pastello Lipcolor Olovka za Usne Vino', '', 'Neve Cosmetics Pastello Lipcolor veganska Olovka za Usne Vino ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Pastello Lipcolor Olovka za Usne Vino', 'Neve Cosmetics Pastello Lipcolor Olovka za Usne Vino vegan'),
