(106, 'rs', '106', 'Single Eyeshadow - Senka za oči Favola', 'single-eyeshadow-senka-za-oci-favola', 'Single Eyeshadow', '<h2 align=\"center\">Opis proizvoda </h2>\r\n<p>Kompaktna nijansa u panu. Čisti pigmenti i formula obogaćena vitaminima garantuju dugotrajan komfort tokom nošenja.</p>\r\n<p><strong>Favola</strong> je mat roze nijansa sa hladnim podtonom. </p>\r\n<p>Pakovanje: 3g proizvoda u panu dijametra 3,6 cm.</p>\r\n<h3 align=\"center\">Po čemu se Single Eyeshadow razlikuje?</h3>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics senka za oči Favola', '', '', 'Neve Cosmetics Senka za oči', 'Neve Cosmetics Senka za oči Favola vegan'),
(107, 'rs', '107', 'Single Eyeshadow - Senka za oči Earl Grey', 'single-eyeshadow-senka-za-oci-earl-grey', 'Single Eyeshadow', '<p>Kompaktna nijansa u panu. Čisti pigmenti i formula obogaćena vitaminima garantuju dugotrajan komfort tokom nošenja.</p>\r\n<p><strong>Earl Grey</strong> je je hladna roze bež nijansa sa velvet finishem. </p>\r\n<p>Pakovanje: 3g proizvoda u panu dijametra 3,6 cm</p>', NULL, NULL, '', '', '', '', ''),
(108, 'rs', '108', 'Aqua Brush Set - Četkice za šminkanje', 'aqua-brush-set-cetkice-za-sminkanje', 'Aqua Brush Set', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p style=\"text-align: left;\"><strong>Aqua Brush Set</strong> je set od sedam profesionalnih četkica za šminkanje u praktičnom kejsu/neseseru sa rajsferšlusom. <br /><br />Četkice su 100% cruelty-free i napravljene od sintetičke dlake. Aqua Brush Set se sastoji od sledećih četkica:</p>\r\n<p><br />Blush Brush - četkica za rumenilo<br />Long-handled Baby Kabuki - kabuki četkica sa dugačkom drškom<br />Baby Blender - četkica za blendanje<br />Eyeliner Brush - četkica za ajlajner<br />Baby Eyebuki - eyebuki odnosno kabuki četkica za oči<br />Small Eyeshadow Brush - mala četkica za senke<br />Medium Eyeliner Brush - srednja ajlajner četkica</p>\r\n<p>Upotreba: mineralni i tečni puderi, rumenila, bronzeri, senke i ajlajneri.</p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Tajna za savršeno blendanje makeup-a i čistu kožu? Redovno čišćenje četkica barem jednom nedeljno! Aqua Brush set ne zahteva posebno sredstvo za čišćenje - možete koristiti blag sapun i mlaku vodu.</p>\r\n<h3 align=\"center\">Po čemu se Aqua Brush Set razlikuje?</h3>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, 'Neve Cosmetics Aqua Brush Set Četkice za šminkanje', '', 'Neve Cosmetics Aqua Brush Set Četkice za šminkanje ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Aqua Brush Set Četkice za šminkanje', 'Neve Cosmetics Aqua Brush Set Četkice za šminkanje'),
(109, 'rs', '109', 'Blending Stamp - Makeup sunđer', 'blending-stamp-makeup-sundjer', 'Blending Stamp ', '<h2 style=\"text-align: center;\"><span>Opis proizvoda</span></h2>\r\n<p style=\"text-align: left;\"><span><strong>Blending Stamp</strong> je sun</span><span>đer za </span><span>šminkanje koji se aktivira sa vodom i pruža glat</span><span>ko i ujednačeno nano</span><span>šenje proizvoda i njihovo blendanje. Oblik </span><span>sunđera je s</span><span>avršen za utapkavanje pudera u kožu.</span></p>\r\n<h3 style=\"text-align: center;\"><span> Beauty saveti</span></h3>\r\n<p><span> Potopiti sun</span><span>đer</span><span> u vodu dok se ne duplira u veli</span><span>čini</span><span> i iscediti vi</span><span>šak vode pre korišćenja</span><span> za savršenu bazu.Koristiti za prajmer, puder, konturisanje, rumenila, pudere u prahu, kremaste i tečne proizvode.</span></p>\r\n<p><span>Nakon upotrebe, oprati sun</span><span>đer sa vodom i blagi</span><span>m sapunom, isprati i pažljivo ga ocediti. Ostaviti sun</span><span>đer na vazduhu da se </span><span>sam osuši i odlo</span><span>žiti ga na čisto i su</span><span>vo mesto. </span>Izbegavati uvijanje i istezanje sunđera.</p>\r\n<h4 align=\"center\">Po čemu se Blending Stamp razlikuje? </h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p><span> Dimenzije suvog sun</span><span>đera</span><span>: visina 6 cm, dijametar 3,7 cm</span></p>\r\n<p><span><br /></span></p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<div><span><br /></span></div>', NULL, NULL, 'Neve Cosmetics Blending Stamp Makeup sunđer za šminkanje', '', 'Neve Cosmetics Blending Stamp Makeup sunđer za šminkanje ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics Sunđer za šminkanje', 'Neve Cosmetics Blending Stamp Sunđer za šminkanje'),
(110, 'rs', '110', 'Customizable Palette x 4 - Paleta Lemon Light', 'customizable-palette-x-4-paleta-lemon-light', 'Customizable Palette x 4', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>Customizable Palette x 4 je profesionalna, prazna paleta koju možete personalizovati omiljenim panovima. </p>\r\n<p>Pogodna je za sve senke i rumenila u panu. Baza palete je magnetna: individualni panovi mogu lako da se repozicioniraju i izvade.</p>\r\n<p>Dimenzija 10 x 10 cm, može da sadrži 4 pana dijametra 3,6 cm. Made in Italy kvalitet.</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<p><span lang=\"IT\"> </span></p>', NULL, NULL, 'Neve Cosmetics paleta za panove i refilove senki i rumenila Lemon Light', '', '', 'Neve Cosmetics paleta za senke i rumenila', 'Neve Cosmetics paleta za senke i rumenila'),
(144, 'rs', '144', 'Još jedna proba', 'jos-jedna-proba', NULL, '<p>šoih š gš9g&nbsp; uiup gigpz&nbsp; i<br></p>', NULL, NULL, NULL, '', NULL, NULL, NULL),
(111, 'rs', '111', 'Customizable Palette x 4 - Paleta Violet Vision', 'customizable-palette-x-4-paleta-violet-vision', 'Customizable Palette x 4', '<h2>Opis proizvoda</h2>\r\n<p>Customizable Palette x 4 je profesionalna, prazna paleta koju možete personalizovati omiljenim panovima. </p>\r\n<p>Pogodna je za sve senke i rumenila u panu. Baza palete je magnetna: individualni panovi mogu lako da se repozicioniraju i izvade.</p>\r\n<p>Dimenzija 10 x 10 cm, može da sadrži 4 pana dijametra 3,6 cm. Made in Italy kvalitet.</p>', NULL, NULL, '', '', '', '', ''),
(112, 'rs', '112', 'DueBaci - 2 u 1 Karmin & Olovka Virgin', 'duebaci-2-u-1-karmin-olovka-virgin', 'DueBaci', '<h2 align=\"center\">Opis proizvoda</h2>\r\n<p style=\"text-align: left;\" align=\"center\">DueBaci je 2 u 1 proizvod za usne: olovka za konturisanje usana i kremasti karmin. DueBaci daju usnama prirodan volumen i sofisticiran izgled. Nijanse olovke i karmina su različite, ali komplementarne i osmišljene su za kreiranje \"ombre\" efekta. </p>\r\n<p style=\"text-align: left;\" align=\"center\"><strong>DueBaci Virgin</strong> je kombinacija tamno mauve i hladno bež nijanse.</p>\r\n<h3 style=\"text-align: center;\" align=\"center\">Beauty saveti</h3>\r\n<p style=\"text-align: left;\" align=\"center\">Naneti olovku prateći željenu liniju usana i blendati ka unutra. Zatim naneti karmin na centralni deo usana i blendati ka spolja. Nakon toga, nežno pritisnuti usne za \"ombre\" efekat. </p>\r\n<h4 align=\"center\">Po čemu se Duebaci razlikuje?</h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet </p>\r\n<p>Pakovanje: drvena olovka sa dva kraja, dijametra 10,5 mm, dužine 120 mm. Sadržaj: olovka punjenje 0,7 g, dijametra 4 mm, karmin 2,1 g, dijametra 7 mm.</p>\r\n<p> </p>\r\n<p><span style=\"background-color: #ffffff; color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>\r\n<p> </p>\r\n<p> </p>', NULL, NULL, 'Neve Cosmetics DueBaci 2 u 1 Karmin i Olovka Virgin', '', 'Neve Cosmetics veganska italijanska šminka DueBaci 2 u 1 Karmin i Olovka Virgin ekskluzivno u Amorina Cosmetics', 'Neve Cosmetics DueBaci Virgin Karmin i Olovka za usne', 'Neve Cosmetics DueBaci Virgin Karmin i Olovka vegan'),
(113, 'rs', '113', 'DueBaci - 2 u 1 Karmin & Olovka Money', 'duebaci-2-u-1-karmin-olovka-money', 'DueBaci', '<h2 style=\"text-align: center;\">Opis proizvoda</h2>\r\n<p>DueBaci je 2 u 1 proizvod za usne: olovka za konturisanje usana i kremasti karmin. DueBaci daju usnama prirodan volumen i sofisticiran izgled. Nijanse olovke i karmina su različite, ali komplementarne i osmišljene su za kreiranje \"ombre\" efekta.</p>\r\n<p><strong>DueBaci Money</strong> je kombinacija plamen crvene i tropikal narandžaste boje.</p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Naneti olovku prateći željenu liniju usana i blendati ka unutra. Zatim naneti karmin na centralni deo usana i blendati ka spolja. Nakon toga, nežno pritisnuti usne za \"ombre\" efekat. </p>\r\n<h4 style=\"text-align: center;\">Po čemu se Duebaci razlikuje?</h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet </p>\r\n<p>Pakovanje: drvena olovka sa dva kraja, dijametra 10,5 mm, dužine 120 mm. Sadržaj: olovka punjenje 0,7 g, dijametra 4 mm, karmin 2,1 g, dijametra 7 mm.</p>\r\n<p> </p>\r\n<p><span style=\"color: #c0c0c0;\">* Težimo da opisi proizoda na sajtu Amorina Cosmetics budu što precizniji, međutim ne možemo da garantujemo da su potpuni i bez grešaka. Fotografije proizvoda su informativnog karaktera i postoji mogućnost da se razlikuju od samih proizvoda i njihovog pakovanja.</span></p>', NULL, NULL, '', '', '', '', ''),
(114, 'rs', '114', 'DueBaci - 2 u 1 Karmin & Olovka Conspiracy', 'duebaci-2-u-1-karmin-olovka-conspiracy', 'DueBaci', '<p>DueBaci je 2 u 1 proizvod za usne: olovka za konturisanje usana i kremasti karmin. DueBaci daju usnama prirodan volumen i sofisticiran izgled. Nijanse olovke i karmina su različite, ali komplementarne i osmišljene su za kreiranje \"ombre\" efekta.</p>\r\n<p><strong>DueBaci Conspiracy</strong> je kombinacija crvene granat boje i tamno hladne boje šljive.</p>\r\n<h3 style=\"text-align: center;\">Beauty saveti</h3>\r\n<p>Naneti olovku prateći željenu liniju usana i blendati ka unutra. Zatim naneti karmin na centralni deo usana i blendati ka spolja. Nakon toga, nežno pritisnuti usne za \"ombre\" efekat. </p>\r\n<h4 style=\"text-align: center;\">Po čemu se Duebaci razlikuje?</h4>\r\n<p>✩ Vegetarijanski &amp; Veganski proizvod: bez sastojaka životinjskog porekla<br />✩ Bez silikona, petrolatuma i parabena<br />✩ Cruelty free: nije testiran na životinjama<br />✩ Made in Italy kvalitet</p>\r\n<p>Pakovanje: drvena olovka sa dva kraja, dijametra 10,5 mm, dužine 120 mm. Sadržaj: olovka punjenje 0,7 g, dijametra 4 mm, karmin 2,1 g, dijametra 7 mm.</p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>', NULL, NULL, '', '', '', '', ''),
